package sort;import java.io.BufferedReader;import java.io.IOException;import java.io.InputStreamReader;public class B11931 {    public static void main(String[] args) throws IOException {        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));        int N = Integer.parseInt(br.readLine());        int[] integerArr = new int[1_000_001];        int[] negativeArr = new int[1_000_001];        for (int i = 0; i < N; i++) {            int number = Integer.parseInt(br.readLine());            if (number < 0) {                negativeArr[number * -1]++;                continue;            }            integerArr[number]++;        }        StringBuilder sb = new StringBuilder();        for (int i = integerArr.length - 1; i >= 0; i--) {            while (integerArr[i] > 0) {                sb.append(i).append('\n');                integerArr[i]--;            }        }        for (int i = 0; i < negativeArr.length; i++) {            while (negativeArr[i] > 0) {                sb.append(i * -1).append('\n');                negativeArr[i]--;            }        }        System.out.println(sb.toString());    }}